import { Button, Tooltip } from 'antd';
import { RightCircleTwoTone, LeftCircleTwoTone } from '@ant-design/icons';

import { connect } from 'react-redux';
import React from 'react'

const MoveTodo = ({ moveTodo, active}) => {

    return (
        <Tooltip placement="top" title={ active === 'COMPLETED' ? 'Move To Todo': 'Move To Completed' }>
             <Button type="link" onClick={moveTodo} >
                { active === 'COMPLETED' ? <LeftCircleTwoTone />:  <RightCircleTwoTone />  }
             </Button>
        </Tooltip>
    )
}

const  mapStateToProps = (ref) => {
    return { active: ref.state.activeComponent };
  }

export default connect(mapStateToProps)(MoveTodo)
